import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { ItemTypes } from './constants';
import { DragSource } from 'react-dnd';

const knightSource = {
    beginDrag(props){
        // If we had a bunch of chess pieces, it might be a
        // good idea to use the props parameter and return
        // something like { pieceId: props.id } instead of {}.
        return {};
    }
}

function collect(connect, monitor){
    return {
        connectDragSource: connect.dragSource(),
        connectDragPreview: connect.dragPreview(),
        isDragging: monitor.isDragging()
    }
}

@DragSource(ItemTypes.KNIGHT, knightSource, collect)
export default class Knight extends Component {
    static propTypes = {
        connectDragSource: PropTypes.func.isRequired,
        isDragging: PropTypes.bool.isRequired
    };

    componentDidMount(){
        const img = new Image();
        // img.src = '../assets/look_at_my_horse.png';
        img.src = 'data:image/png;base64,';
  
        img.onload = () => this.props.connectDragPreview(img);
    }

    render(){
        const { connectDragSource, isDragging } = this.props;
        return connectDragSource (
            <div style={{
                opacity: isDragging ? 0.5 : 1,
                fontSize: '5vh',
                fontWeight: 'bold',
                cursor: 'move',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                textAlign: 'center',
                height: '100%',
            }}>
                ♘
            </div>
        );
    };
}
